  return(
    <div name='menu' class="flex h-screen justify-center items-center flex-col">
        <div
            class="w-full h-screen bg-[url('https://images.pexels.com/photos/942803/pexels-photo-942803.jpeg')] bg-cover bg-center">
            <div class="w-full h-full flex  justify-center items-center backdrop-brightness-70">
                    <span class="text-white text-4xl w-1/2 text-center">Here is an example of black overlay on an image</span>
